r API logging purposes. Example: tap-quickbooks <api_user_email@your_company.com>."}, "client_secret": {"type": "string", "title": "Client Secret", "description": " Obtain this value from the Keys tab on the app profile via My Apps on the developer site. There are two versions of this key: development and production.", "airbyte_secret": true}, "refresh_token": {"type": "string", "title": "Refresh Token", "description": "A token used when refreshing the access token.", "airbyte_secret": true}}, "additionalProperties": false}, "supported_destination_sync_modes": []}','alpha',null,null,'0','1','','0','system','2022-09-06 09:07:02','system','2022-09-06 09:23:44');
