insert into ds_task.actor_definition(`id`,`name`,`docker_repository`,`docker_image_tag`,`documentation_url`,`icon`,`actor_type`,`source_type`,`spec`,`release_stage`,`release_date`,`resource_requirements`,`for_ds_template`,`is_open`,`description`,`delete_status`,`create_by`,`create_time`,`update_by`,`update_time`) values ('361','Google Analytics','airbyte/source-google-analytics-v4','0.1.21','https://docs.airbyte.io/integrations/sources/google-analytics-v4','https://cbs-flink-sg.obs.ap-southeast-3.myhuaweicloud.com/icons/google-analytics.svg','source','api','{"supportsDBT": false, "documentationUrl": "https://docs.airbyte.io/integrations/sources/google-analytics-v4", "authSpecification": {"auth_type": "oauth2.0", "oauth2Specification": {"rootObject": ["credentials", "0"], "oauthFlowInitParameters": [["client_id"], ["client_secret"]], "oauthFlowOutputParameters": [["access_token"], ["refresh_token"]]}}, "supportsNormalization": false, "connectionSpecification": {"type": "object", "title": "Google Analytics V4 Spec", "$schema": "http://json-schema.org/draft-07/schema#", "required": ["view_id", "start_date"], "properties": {"view_id": {"type": "string", "order": 2, "title": "View ID", "description": "The ID for the Google Analytics View you want to fetch data from. This can be found from the <a href=\\"https://ga-dev-tools.appspot.com/account-explorer/\\">Google Analytics Account Explorer</a>."}, "start_date": {"type": "string", "order": 1, "title": "Replication Start Date", "examples": ["2020-06-01"], "description": "The date in the format YYYY-MM-DD. Any data before this date will not be replicated."}, "credentials": {"type": "object", "oneOf": [{"type": "object", "title": "Authenticate via Google (Oauth)", "required": ["client_id", "client_secret", "refresh_token"], "properties": {"auth_type": {"type": "string", "const": "Client", "order": 0}, "client_id": {"type": "string", "order": 1, "title": "Client ID", "description": "The Client ID of your Google Analytics deve