nism", "sasl_jaas_config"], "properties": {"sasl_mechanism": {"enum": ["GSSAPI", "OAUTHBEARER", "SCRAM-SHA-256", "SCRAM-SHA-512", "PLAIN"], "type": "string", "title": "SASL Mechanism", "default": "GSSAPI", "description": "The SASL mechanism used for client connections. This may be any mechanism for which a security provider is available."}, "sasl_jaas_config": {"type": "string", "title": "SASL JAAS Config", "default": "", "description": "The JAAS login context parameters for SASL connections in the format used by JAAS configuration files.", "airbyte_secret": true}, "security_protocol": {"enum": ["SASL_SSL"], "type": "string", "default": "SASL_SSL"}}}], "title": "Protocol", "description": "The Protocol used to communicate with brokers."}, "client_id": {"type": "string", "title": "Client ID", "examples": ["airbyte-consumer"], "description": "An ID string to pass to the server when making requests. The purpose of this is to be able to track the source of requests beyond just ip/port by allowing a logical application name to be included in server-side request logging."}, "test_topic": {"type": "string", "title": "Test Topic", "examples": ["test.topic"], "description": "The Topic to test in case the Airbyte can consume messages."}, "subscription": {"type": "object", "oneOf": [{"title": "Manually assign a list of partitions", "required": ["subscription_type", "topic_partitions"], "properties": {"topic_partitions": {"type": "string", "title": "List of topic:partition Pairs", "examples": ["sample.topic:0, sample.topic:1"]}, "subscription_type": {"enum": ["assign"], "type": "string", "const": "assign", "default": "assign", "description": "Manually assign a list of partitions to this consumer. This interface does not allow for incremental assignment and will replace the previous assignment (if there is one).\\nIf the given list of topic partitions is empty, it is treated the same as unsubscribe()."}}}, {"title": "Subscribe to all topics matching specified pattern", "required": ["subscription_type", "topic_pattern"], "properties": {"topic_pattern": {"type": "string", "title": "Topic Pattern", "examples": ["sample.topic"]}, "subscription_type": {"enum": ["subscribe"], "type": "string", "const": "subscribe", "default": "subscribe", "description": "The Topic pattern from which the records will be read."}}}], "title": "Subscription Method", "description": "You can choose to manually assign a list of partitions, or subscribe to all topics matching specified pattern to get dynamically assigned partitions."}, "repeated_calls": {"type": "integer", "title": "Repeated Calls", "default": 3, "description": "The number of repeated calls to poll() if no messages were received."}, "max_poll_records": {"type": "integer", "title": "Max Poll Records", "default": 500, "description": "The maximum number of records returned in a single call to poll(). Note, that max_poll_records does not impact the underlying fetching behavior. The consumer will cache the records from each fetch request and returns them incrementally from each poll."}, "retry_backoff_ms": {"type": "integer", "title": "Retry Backoff, ms", "default": 100, "description": "The amount of time to wait before attempting to retry a failed request to a given topic partition. This avoids repeatedly sending requests in a tight loop under some failure scenarios."}, "auto_offset_reset": {"enum": ["latest", "earliest", "none"], "type": "string", "title": "Auto Offset Reset", "default": "latest", "description": "What to do when there is no initial offset in Kafka or if the current offset does not exist any more on the server - earliest: automatically reset the offset to the earliest offset, latest: automatically reset the offset to the latest offset, none: throw exception to the consumer if no previous offset is found for the consumer\'s group, anything else: throw exception to the consumer."}, "bootstrap_servers": {"type": "string", "title": "Bootstrap Servers", "examples": ["kafka-broker1:9092,kafka-broker2:9092"], "description": "A list of host/port pairs to use for establishing the initial connection to the Kafka cluster. The client will make use of all servers irrespective of which servers are specified here for bootstrapping&mdash;this list only impacts the initial hosts used to discover the full set of servers. This list should be in the form <code>host1:port1,host2:port2,...</code>. Since these servers are just used for the initial connection to discover the full cluster membership (which may change dynamically), this list need not contain the full set of servers (you may want more than one, though, in case a server is down)."}, "client_dns_lookup": {"enum": ["default", "use_all_dns_ips", "resolve_canonical_bootstrap_servers_only"], "type": "string", "title": "Client DNS Lookup", "default": "use_all_dns_ips", "description": "Controls how the client uses DNS lookups. If set to use_all_dns_ips, connect to each returned IP address in sequence until a successful connection is established. After a disconnection, the next IP is used. Once all IPs have been used once, the client resolves the IP(s) from the hostname again. If set to resolve_canonical_bootstrap_servers_only, resolve each bootstrap address into a list of canonical names. After the bootstrap phase, this behaves the same as use_all_dns_ips. If set to default (deprecated), attempt to connect to the first IP address returned by the lookup, even if the lookup returns multiple IP addresses."}, "enable_auto_commit": {"type": "boolean", "title": "Enable Auto Commit", "default": true, "description": "If true, the consumer\'s offset will be periodically committed in the background."}, "request_timeout_ms": {"type": "integer", "title": "Request Timeout, ms", "default": 30000, "description": "The configuration controls the maximum amount of time the client will wait for the response of a request. If the response is not received before the timeout elapses the client will resend the request if necessary or fail the request if retries are exhausted."}, "receive_buffer_bytes": {"type": "integer", "title": "Receive Buffer, bytes", "default": 32768, "description": "The size of the TCP receive buffer (SO_RCVBUF) to use when reading data. If the value is -1, the OS default will be used."}, "auto_commit_interval_ms": {"type": "integer", "title": "Auto Commit Interval, ms", "default": 5000, "description": "The frequency in milliseconds that the consumer offsets are auto-committed to Kafka if enable.auto.commit is set to true."}}, "additionalProperties": false}, "supported_source_sync_modes": ["append"], "supported_destination_sync_modes": []}','alpha',null,null,'0','1','','0','system','2022-09-06 09:07:12','system','2022-09-06 09:23:44');
