es": ["10"], "description": "Increase this if syncing tables larger than 100GB. Only relevant for COPY. Files are streamed to S3 in parts. This determines the size of each part, in MBs. As S3 has a limit of 10,000 parts per file, part size affects the table size. This is 10MB by default, resulting in a default limit of 100GB tables. Note: a larger part size will result in larger memory requirements. A rule of thumb is to multiply the part size by 10 to get the memory requirement. Modify this with care. See <a href=\\"https://docs.airbyte.com/integrations/destinations/redshift/#:~:text=above%20key%20id.-,Part%20Size,-Affects%20the%20size\\",> docs</a> for details."}, "access_key_id": {"type": "string", "title": "S3 Key Id (Optional)", "description": "This ID grants access to the above S3 staging bucket. Airbyte requires Read and Write permissions to the given bucket. See <a href=\\"https://docs.aws.amazon.com/general/latest/gr/aws-sec-cred-types.html#access-keys-and-secret-access-keys\\">AWS docs</a> on how to generate an access key ID and secret access key.", "airbyte_secret": true}, "s3_bucket_name": {"type": "string", "title": "S3 Bucket Name (Optional)", "examples": ["airbyte.staging"], "description": "The name of the staging S3 bucket to use if utilising a COPY strategy. COPY is recommended for production workloads for better speed and scalability. See <a href=\\"https://docs.aws.amazon.com/AmazonS3/latest/userguide/creating-bucket.html\\">AWS docs</a> for more details."}, "s3_bucket_path": {"type": "string", "title": "S3 Bucket Path (Optional)", "examples": ["data_sync/test"], "description": "The directory under the S3 bucket where data will be written. If not provided, then defaults to the root directory. See <a href=\\"https://docs.aws.amazon.com/prescriptive-guidance/latest/defining-bucket-names-data-lakes/faq.html#:~:text=be%20globally%20unique.-,For%20S3%20bucket%20paths,-%2C%20you%20can%20use\\">path\'s name recommendations</a> for more details."}, "s3_bucket_region": {"enum": ["", "us-east-1", "us-east-2", "us-west-1", "us-west-2", "af-south-1", "ap-east-1", "ap-south-1", "ap-northeast-1", "ap-northeast-2", "ap-northeast-3", "ap-southeast-1", "ap-southeast-2", "ca-central-1", "cn-north-1", "cn-northwest-1", "eu-central-1", "eu-north-1", "eu-south-1", "eu-west-1", "eu-west-2", "eu-west-3", "sa-east-1", "me-south-1"], "type": "string", "title": "S3 Bucket Region (Optional)", "default": "", "description": "The region of the S3 staging bucket to use if utilising a COPY strategy. See <a href=\\"https://docs.aws.amazon.com/AmazonS3/latest/userguide/creating-bucket.html#:~:text=In-,Region,-%2C%20choose%20the%20AWS\\">AWS docs</a> for details."}, "secret_access_key": {"type": "string", "title": "S3 Access Key (Optional)", "description": "The corresponding secret to the above access key id. See <a href=\\"https://docs.aws.amazon.com/general/latest/gr/aws-sec-cred-types.html#access-keys-and-secret-access-keys\\">AWS docs</a> on how to generate an access key ID and secret access key.", "airbyte_secret": true}, "purge_staging_data": {"type": "boolean", "title": "Purge Staging Files and Tables (Optional)", "default": true, "description": "Whether to delete the staging files from S3 after completing the sync. See <a href=\\"https://docs.airbyte.com/integrations/destinations/redshift/#:~:text=the%20root%20directory.-,Purge%20Staging%20Data,-Whether%20to%20delete\\"> docs</a> for details."}}, "additionalProperties": true}, "supported_destination_sync_modes": ["overwrite", "append", "append_dedup"]}','beta',null,'{"jobSpecific": [{"jobType": "sync", "resourceRequirements": {"memory_limit": "1Gi", "memory_request": "1Gi"}}]}','0','1','','0','system','2022-09-06 09:07:25','system','2022-09-06 09:23:44');
