insert into ds_task.actor_definition(`id`,`name`,`docker_repository`,`docker_image_tag`,`documentation_url`,`icon`,`actor_type`,`source_type`,`spec`,`release_stage`,`release_date`,`resource_requirements`,`for_ds_template`,`is_open`,`description`,`delete_status`,`create_by`,`create_time`,`update_by`,`update_time`) values ('387','Google Cloud Storage (GCS)','airbyte/destination-gcs','0.2.6','https://docs.airbyte.io/integrations/destinations/gcs','https://cbs-flink-sg.obs.ap-southeast-3.myhuaweicloud.com/icons/googlecloudstorage.svg','destination',null,'{"$schema": "http://json-schema.org/draft-07/schema#", "supportsDBT": false, "documentationUrl": "https://docs.airbyte.io/integrations/destinations/gcs", "supportsIncremental": true, "supportsNormalization": false, "connectionSpecification": {"type": "object", "title": "GCS Destination Spec", "$schema": "http://json-schema.org/draft-07/schema#", "required": ["gcs_bucket_name", "gcs_bucket_path", "credential", "format"], "properties": {"format": {"type": "object", "oneOf": [{"title": "Avro: Apache Avro", "required": ["format_type", "compression_codec"], "properties": {"format_type": {"enum": ["Avro"], "type": "string", "default": "Avro"}, "part_size_mb": {"type": "integer", "title": "Block Size (MB) for GCS multipart upload (Optional)", "default": 5, "examples": [5], "description": "This is the size of a \\"Part\\" being buffered in memory. It limits the memory usage when writing. Larger values will allow to upload a bigger files and improve the speed, but consumes9 more memory. Allowed values: min=5MB, max=525MB Default: 5MB."}, "compression_codec": {"type": "object", "oneOf": [{"title": "No Compression", "required": ["codec"], "properties": {"codec": {"enum": ["no compression"], "type": "string", "default": "no compression"}}}, {"title": "Deflate", "required": ["codec"], "properties": {"codec": {"enum": ["Deflate"], "type": "string", "default": "Deflate"}, "compression_level": {"type": "integer", "title": "Deflate leve