ustom Query", "examples": ["SELECT segments.ad_destination_type, campaign.advertising_channel_sub_type FROM campaign WHERE campaign.status = \'PAUSED\'"], "description": "A custom defined GAQL query for building the report. Should not contain segments.date expression because it is used by incremental streams. See Google\'s <a href=\\"https://developers.google.com/google-ads/api/fields/v9/overview_query_builder\\">query builder</a> for more information."}, "table_name": {"type": "string", "title": "Destination Table Name", "description": "The table name in your destination database for choosen query."}}}, "order": 3, "title": "Custom GAQL Queries (Optional)", "description": ""}, "login_customer_id": {"type": "string", "order": 4, "title": "Login Customer ID for Managed Accounts (Optional)", "pattern": "^([0-9]{10})?$", "examples": ["7349206847"], "description": "If your access to the customer account is through a manager account, this field is required and must be set to the customer ID of the manager account (10-digit number without dashes). More information about this field you can see <a href=\\"https://developers.google.com/google-ads/api/docs/concepts/call-structure#cid\\">here</a>"}, "conversion_window_days": {"type": "integer", "order": 5, "title": "Conversion Window (Optional)", "default": 14, "maximum": 1095, "minimum": 0, "examples": [14], "description": "A conversion window is the period of time after an ad interaction (such as an ad click or video view) during which a conversion, such as a purchase, is recorded in Google Ads. For more information, see Google\'s <a href=\\"https://support.google.com/google-ads/answer/3123169?hl=en\\">documentation</a>."}}, "additionalProperties": true}, "supported_destination_sync_modes": []}','generally_available',null,null,'0','1','','0','system','2022-09-06 09:07:59','system','2022-09-06 09:23:44');
