nges."}, "replication_slot": {"type": "string", "order": 2, "title": "Replication Slot", "description": "A plug-in logical replication slot."}}, "description": "Logical replication uses the Postgres write-ahead log (WAL) to detect inserts, updates, and deletes. This needs to be configured on the source database itself. Only available on Postgres 10 and above. Read the <a href=\\"https://docs.airbyte.com/integrations/sources/postgres\\">Postgres Source</a> docs for more information.", "additionalProperties": false}], "order": 8, "title": "Replication Method", "description": "Replication method to use for extracting data from the database."}}, "additionalProperties": false}, "supported_destination_sync_modes": []}','alpha',null,null,'0','1','','0','system','2022-09-06 09:08:21','system','2022-09-06 09:23:44');
