insert into ds_task.actor_definition(`id`,`name`,`docker_repository`,`docker_image_tag`,`documentation_url`,`icon`,`actor_type`,`source_type`,`spec`,`release_stage`,`release_date`,`resource_requirements`,`for_ds_template`,`is_open`,`description`,`delete_status`,`create_by`,`create_time`,`update_by`,`update_time`) values ('502','Kafka','airbyte/destination-kafka','0.1.8','https://docs.airbyte.io/integrations/destinations/kafka','https://cbs-flink-sg.obs.ap-southeast-3.myhuaweicloud.com/icons/kafka.svg','destination',null,'{"supportsDBT": false, "documentationUrl": "https://docs.airbyte.io/integrations/destinations/kafka", "supportsIncremental": true, "supportsNormalization": false, "connectionSpecification": {"type": "object", "title": "Kafka Destination Spec", "$schema": "http://json-schema.org/draft-07/schema#", "required": ["bootstrap_servers", "topic_pattern", "protocol", "acks", "enable_idempotence", "compression_type", "batch_size", "linger_ms", "max_in_flight_requests_per_connection", "client_dns_lookup", "buffer_memory", "max_request_size", "retries", "socket_connection_setup_timeout_ms", "socket_connection_setup_timeout_max_ms", "max_block_ms", "request_timeout_ms", "delivery_timeout_ms", "send_buffer_bytes", "receive_buffer_bytes"], "properties": {"acks": {"enum": ["0", "1", "all"], "type": "string", "title": "ACKs", "default": "1", "description": "The number of acknowledgments the producer requires the leader to have received before considering a request complete. This controls the  durability of records that are sent."}, "retries": {"type": "integer", "title": "Retries", "examples": [2147483647], "description": "Setting a value greater than zero will cause the client to resend any record whose send fails with a potentially transient error."}, "protocol": {"type": "object", "oneOf": [{"title": "PLAINTEXT", "required": ["security_protocol"], "properties": {"security_protocol": {"enum": ["PLAINTEXT"], "type": "string", "default": "PLAINTEXT"}}}, {"title": "SASL PLAINTEXT", "required": ["security_protocol", "sasl_mechanism", "sasl_jaas_config"], "properties": {"sasl_mechanism": {"enum": ["PLAIN"], "type": "string", "title": "SASL Mechanism", "default": "PLAIN", "description": "SASL mechanism used for client connections. This may be any mechanism for which a security provider is available."}, "sasl_jaas_config": {"type": "string", "title": "SASL JAAS Config", "default": "", "description": "JAAS login context parameters for SASL connections in the format used by JAAS configuration files.", "airbyte_secret": true}, "security_protocol": {"enum": ["SASL_PLAINTEXT"], "type": "string", "default": "SASL_PLAINTEXT"}}}, {"title": "SASL SSL", "required": ["security_protocol", "sasl_mechanism", "sasl_jaas_config"], "properties": {"sasl_mechanism": {"enum": ["GSSAPI", "OAUTHBEARER", "SCRAM-SHA-256", "SCRAM-SHA-512", "PLAIN"], "type": "string", "title": "SASL Mechanism", "default": "GSSAPI", "description": "SASL mechanism used for client connections. This may be any mechanism for which a security provider is available."}, "sasl_jaas_config": {"type": "string", "title": "SASL JAAS Config", "default": "", "description": "JAAS login context parameters for SASL connections in the format used by JAAS configuration files.", "airbyte_secret": true}, "security_protocol": {"enum": ["SASL_SSL"], "type": "string", "default": "SASL_SSL"}}}], "title": "Protocol", "description": "Protocol used to communicate with brokers."}, "client_id": {"type": "string", "title": "Client ID", "examples": ["airbyte-producer"], "description": "An ID string to pass to the server when making requests. The purpose of this is to be able to track the source of requests beyond just ip/port by allowing a logical application name to be included in server-side request logging."}, "linger_ms": {"type": "string", "title": "Linger ms", "examples": [0], "description": "The producer groups together any records that arrive in between request transmissions into a single batched request."}, "batch_size": {"type": "integer", "title": "Batch Size", "examples": [16384], "description": "The producer will attempt to batch records together into fewer requests whenever multiple records are being sent to the same partition."}, "test_topic": {"type": "string", "title": "Test Topic", "examples": ["test.topic"], "description": "Topic to test if Airbyte can produce messages."}, "max_block_ms": {"type": "string", "title": "Max Block ms", "examples": [60000], "description": "The configuration controls how long the KafkaProducer\'s send(), partitionsFor(), initTransactions(), sendOffsetsToTransaction(), commitTransaction() and abortTransaction() methods will block."}, "buffer_memory": {"type": "string", "title": "Buffer Memory", "examples": 33554432, "description": "The total bytes of memory the producer can use to buffer records waiting to be sent to the server."}, "sync_producer": {"type": "boolean", "title": "Sync Producer", "default": false, "description": "Wait synchronously until the record has been sent to Kafka."}, "topic_pattern": {"type": "string", "title": "Topic Pattern", "examples": ["sample.topic", "{namespace}.{stream}.sample"], "description": "Topic pattern in which the records will be sent. You can use patterns like \'{namespace}\' and/or \'{stream}\' to send the message to a specific topic based on these values. Notice that the topic name will be transformed to a standard naming convention."}, "compression_type": {"enum": ["none", "gzip", "snappy", "lz4", "zstd"], "type": "string", "title": "Compression Type", "default": "none", "description": "The compression type for all data generated by the producer."}, "max_request_size": {"type": "integer", "title": "Max Request Size", "examples": [1048576], "description": "The maximum size of a request in bytes."}, "bootstrap_servers": {"type": "string", "title": "Bootstrap Servers", "examples": ["kafka-broker1:9092,kafka-broker2:9092"], "description": "A list of host/port pairs to use for establishing the initial connection to the Kafka cluster. The client will make use of all servers irrespective of which servers are specified here for bootstrapping&mdash;this list only impacts the initial hosts used to discover the full set of servers. This list should be in the form <code>host1:port1,host2:port2,...</code>. Since these servers are just used for the initial connection to discover the full cluster membership (which may change dynamically), this list need not contain the full set of servers (you may want more than one, though, in case a server is down)."}, "client_dns_lookup": {"enum": ["default", "use_all_dns_ips", "resolve_canonical_bootstrap_servers_only", "use_all_dns_ips"], "type": "string", "title": "Client DNS Lookup", "default": "use_all_dns_ips", "description": "Controls how the client uses DNS lookups. If set to use_all_dns_ips, connect to each returned IP address in sequence until a successful connection is established. After a disconnection, the next IP is used. Once all IPs have been used once, the client resolves the IP(s) from the hostname again. If set to resolve_canonical_bootstrap_servers_only, resolve each bootstrap address into a list of canonical names. After the bootstrap phase, this behaves the same as use_all_dns_ips. If set to default (deprecated), attempt to connect to the first IP address returned by the lookup, even if the lookup returns multiple IP addresses."}, "send_buffer_bytes": {"type": "integer", "title": "Send Buffer bytes", "examples": [131072], "description": "The size of the TCP send buffer (SO_SNDBUF) to use when sending data. If the value is -1, the OS default will be used."}, "enable_idempotence": {"type": "boolean", "title": "Enable Idempotence", "default": false, "description": "When set to \'true\', the producer will ensure that exactly one copy of each message is written in the stream. If \'false\', producer retries due to broker failures, etc., may write duplicates of the retried message in the stream."}, "request_timeout_ms": {"type": "integer", "title": "Request Timeout", "examples": [30000], "description": "The configuration controls the maximum amount of time the client will wait for the response of a request. If the response is not received before the timeout elapses the client will resend the request if necessary or fail the request if retries are exhausted."}, "delivery_timeout_ms": {"type": "integer", "title": "Delivery Timeout", "examples": [120000], "description": "An upper bound on the time to report success or failure after a call to \'send()\' returns."}, "receive_buffer_bytes": {"type": "integer", "title": "Receive Buffer bytes", "examples": [32768], "description": "The size of the TCP receive buffer (SO_RCVBUF) to use when reading data. If the value is -1, the OS default will be used."}, "socket_connection_setup_timeout_ms": {"type": "string", "title": "Socket Connection Setup Timeout", "examples": [10000], "description": "The amount of time the client will wait for the socket connection to be established."}, "max_in_flight_requests_per_connection": {"type": "integer", "title": "Max in Flight Requests per Connection", "examples": [5], "description": "The maximum number of unacknowledged requests the client will send on a single connection before blocking. Can be greater than 1, and the maximum value supported with idempotency is 5."}, "socket_connection_setup_timeout_max_ms": {"type": "string", "title": "Socket Connection Setup Max Timeout", "examples": [30000], "description": "The maximum amount of time the client will wait for the socket connection to be established. The connection setup timeout will increase exponentially for each consecutive connection failure up to this maximum."}}, "additionalProperties": true}, "supported_destination_sync_modes": ["append"]}','alpha',null,null,'0','1','','0','system','2022-09-06 09:09:09','system','2022-09-06 09:23:44');
