se for sending messages", "airbyte_secret": true}, "message_delay": {"type": "integer", "order": 2, "title": "Message Delay", "examples": ["15"], "description": "Modify the Message Delay of the individual message from the Queue\'s default (seconds)."}, "message_body_key": {"type": "string", "order": 5, "title": "Message Body Key", "examples": ["myDataPath"], "description": "Use this property to extract the contents of the named key in the input record to use as the SQS message body. If not set, the entire content of the input record data is used as the message body."}, "message_group_id": {"type": "string", "order": 6, "title": "Message Group Id", "examples": ["my-fifo-group"], "description": "The tag that specifies that a message belongs to a specific message group. This parameter applies only to, and is REQUIRED by, FIFO queues."}}, "additionalProperties": false}, "supported_destination_sync_modes": ["append"]}','alpha',null,null,'0','1','','0','system','2022-09-06 09:09:10','system','2022-09-06 09:23:44');
insert into ds_task.actor_definition(`id`,`name`,`docker_repository`,`docker_image_tag`,`documentation_url`,`icon`,`actor_type`,`source_type`,`spec`,`release_stage`,`release_date`,`resource_requirements`,`for_ds_template`,`is_open`,`description`,`delete_status`,`create_by`,`create_time`,`update_by`,`update_time`) values ('505','Pulsar','airbyte/destination-pulsar','0.1.1','https://docs.airbyte.io/integrations/destinations/pulsar','https://cbs-flink-sg.obs.ap-southeast-3.myhuaweicloud.com/icons/pulsar.svg','destination',null,'{"supportsDBT": false, "documentationUrl": "https://docs.airbyte.io/integrations/destinations/pulsar", "supportsIncremental": true, "supportsNormalization": false, "connectionSpecification": {"type": "object", "title": "Pulsar Destination Spec", "$schema": "http://json-schema.org/draft-07/schema#", "required": ["brokers", "use_tls", "topic_type", "topic_tenant", "topic_namespace", "topic_pattern", "compression_type", "send_timeout_ms", "max_pending_messages", "max_pending_messages_across_partitions", "batching_enabled", "batching_max_messages", "batching_max_publish_delay", "block_if_queue_full"], "properties": {"brokers": {"type": "string", "title": "Pulsar brokers", "examples": ["broker1:6650,broker2:6650"], "description": "A list of host/port pairs to use for establishing the initial connection to the Pulsar cluster."}, "use_tls": {"type": "boolean", "title": "Use TLS", "default": false, "description": "Whether to use TLS encryption on the connection."}, "topic_test": {"type": "string", "title": "Test topic", "examples": ["test.topic"], "description": "Topic to test if Airbyte can produce messages."}, "topic_type": {"enum": ["persistent", "non-persistent"], "type": "string", "title": "Topic type", "default": "persistent", "description": "It identifies type of topic. Pulsar supports two kind of topics: persistent and non-persistent. In persistent topic, all messages are durably persisted on disk (that means on multiple disks unless the broker is standalone), whereas non-persistent topic does not persist message into storage disk."}, "topic_tenant": {"type": "string", "title": "Topic tenant", "default": "public", "examples": ["public"], "description": "The topic tenant within the instance. Tenants are essential to multi-tenancy in Pulsar, and spread across clusters."}, "producer_name": {"type": "string", "title": "Producer name", "examples": ["airbyte-producer"], "description": "Name for the producer. If not filled, the system will generate a globally unique name which can be accessed with."}, "producer_sync": {"type": "boolean", "title": "Sync producer", "default": false, "description": "Wait synchronously until the record has been sent to Pulsar."}, "topic_pattern": {"type": "string", "title": "Topic pattern", "examples": ["sample.topic", "{namespace}.{stream}.sample"], "description": "Topic pattern in which the records will be sent. You can use patterns like \'{namespace}\' and/or \'{stream}\' to send the message to a specific topic based on these values. Notice that the topic name will be transformed to a standard naming convention."}, "send_timeout_ms": {"type": "integer", "title": "Message send timeout", "default": 30000, "description": "If a message is not acknowledged by a server before the send-timeout expires, an error occurs (in ms)."}, "topic_namespace": {"type": "string", "title": "Topic namespace", "default": "default", "examples": ["default"], "description": "The administrative unit of the topic, which acts as a grouping mechanism for related topics. Most topic configuration is performed at the namespace level. Each tenant has one or multiple namespaces."}, "batching_enabled": {"type": "boolean", "title": "Enable batching", "default": true, "description": "Control whether automatic batching of messages is enabled for the producer."}, "compression_type": {"enum": ["NONE", "LZ4", "ZLIB", "ZSTD", "SNAPPY"], "type": "string", "title": "Compression type", "default": "NONE", "description": "Compression type for the producer."}, "block_if_queue_full": {"type": "boolean", "title": "Block if queue is full", "default": false, "description": "If the send operation should block when the outgoing message queue is full."}, "max_pending_messages": {"type": "integer", "title": "Max pending messages", "default": 1000, "description": "The maximum size of a queue holding pending messages."}, "batching_max_messages": {"type": "integer", "title": "Batching max messages", "default": 1000, "description": "Maximum number of messages permitted in a batch."}, "batching_max_publish_delay": {"type": "integer", "title": "Batching max publish delay", "default": 1, "description": " Time period in milliseconds within which the messages sent will be batched."}, "max_pending_messages_across_partitions": {"type": "integer", "title": "Max pending messages across partitions", "default": 50000, "description": "The maximum number of pending messages across partitions."}}, "additionalProperties": true}, "supported_destination_sync_modes": ["append"]}','alpha',null,null,'0','1','','0','system','2022-09-06 09:09:11','system','2022-09-06 09:23:44');
