itle": "Compression Level", "default": 6, "maximum": 9, "minimum": 0, "description": "See <a href=\\"https://commons.apache.org/proper/commons-compress/apidocs/org/apache/commons/compress/compressors/xz/XZCompressorOutputStream.html#XZCompressorOutputStream-java.io.OutputStream-int-\\">here</a> for details."}}}, {"title": "zstandard", "required": ["codec", "compression_level"], "properties": {"codec": {"enum": ["zstandard"], "type": "string", "default": "zstandard"}, "include_checksum": {"type": "boolean", "title": "Include Checksum", "default": false, "description": "If true, include a checksum with each data block."}, "compression_level": {"type": "integer", "title": "Compression Level", "default": 3, "maximum": 22, "minimum": -5, "description": "Negative levels are \'fast\' modes akin to lz4 or snappy, levels above 9 are generally for archival purposes, and levels above 18 use a lot of memory."}}}, {"title": "snappy", "required": ["codec"], "properties": {"codec": {"enum": ["snappy"], "type": "string", "default": "snappy"}}}], "order": 1, "title": "Compression Codec *", "description": "The compression algorithm used to compress data. Default to no compression."}}}, {"title": "CSV: Comma-Separated Values", "required": ["format_type", "flattening"], "properties": {"flattening": {"enum": ["No flattening", "Root level flattening"], "type": "string", "title": "Normalization (Flattening)", "default": "No flattening", "description": "Whether the input json data should be normalized (flattened) in the output CSV. Please refer to docs for details."}, "compression": {"type": "object", "oneOf": [{"title": "No Compression", "requires": ["compression_type"], "properties": {"compression_type": {"enum": ["No Compression"], "type": "string", "default": "No Compression"}}}, {"title": "GZIP", "requires": ["compression_type"], "properties": {"compression_type": {"enum": ["GZIP"], "type": "string", "default": "GZIP"}}}], "title": "Compression", "description": "Whether the output files should be compressed. If compression is selected, the output filename will have an extra extension (GZIP: \\".csv.gz\\")."}, "format_type": {"enum": ["CSV"], "type": "string", "title": "Format Type *", "default": "CSV"}}}, {"title": "JSON Lines: Newline-delimited JSON", "required": ["format_type"], "properties": {"compression": {"type": "object", "oneOf": [{"title": "No Compression", "requires": "compression_type", "properties": {"compression_type": {"enum": ["No Compression"], "type": "string", "default": "No Compression"}}}, {"title": "GZIP", "requires": "compression_type", "properties": {"compression_type": {"enum": ["GZIP"], "type": "string", "default": "GZIP"}}}], "title": "Compression", "description": "Whether the output files should be compressed. If compression is selected, the output filename will have an extra extension (GZIP: \\".jsonl.gz\\")."}, "format_type": {"enum": ["JSONL"], "type": "string", "title": "Format Type *", "default": "JSONL"}}}, {"title": "Parquet: Columnar Storage", "required": ["format_type"], "properties": {"format_type": {"enum": ["Parquet"], "type": "string", "title": "Format Type *", "default": "Parquet"}, "page_size_kb": {"type": "integer", "title": "Page Size (KB) (Optional)", "default": 1024, "examples": [1024], "description": "The page size is for compression. A block is composed of pages. A page is the smallest unit that must be read fully to access a single record. If this value is too small, the compression will deteriorate. Default: 1024 KB."}, "block_size_mb": {"type": "integer", "title": "Block Size (Row Group Size) (MB) (Optional)", "default": 128, "examples": [128], "description": "This is the size of a row group being buffered in memory. It limits the memory usage when writing. Larger values will improve the IO when reading, but consume more memory when writing. Default: 128 MB."}, "compression_codec": {"enum": ["UNCOMPRESSED", "SNAPPY", "GZIP", "LZO", "BROTLI", "LZ4", "ZSTD"], "type": "string", "title": "Compression Codec (Optional)", "default": "UNCOMPRESSED", "description": "The compression algorithm used to compress data pages."}, "dictionary_encoding": {"type": "boolean", "title": "Dictionary Encoding (Optional)", "default": true, "description": "Default: true."}, "max_padding_size_mb": {"type": "integer", "title": "Max Padding Size (MB) (Optional)", "default": 8, "examples": [8], "description": "Maximum size allowed as padding to align row groups. This is also the minimum size of a row group. Default: 8 MB."}, "dictionary_page_size_kb": {"type": "integer", "title": "Dictionary Page Size (KB) (Optional)", "default": 1024, "examples": [1024], "description": "There is one dictionary page per column per row group when dictionary encoding is used. The dictionary page size works like the page size but for dictionary. Default: 1024 KB."}}}], "order": 5, "title": "Output Format *", "description": "Format of the data output. See <a href=\\"https://docs.airbyte.com/integrations/destinations/s3/#supported-output-schema\\">here</a> for more details"}, "s3_endpoint": {"type": "string", "order": 6, "title": "Endpoint (Optional)", "default": "", "examples": ["http://localhost:9000"], "description": "Your S3 endpoint url. Read more <a href=\\"https://docs.aws.amazon.com/general/latest/gr/s3.html#:~:text=Service%20endpoints-,Amazon%20S3%20endpoints,-When%20you%20use\\">here</a>"}, "access_key_id": {"type": "string", "order": 0, "title": "S3 Key ID *", "examples": ["A012345678910EXAMPLE"], "description": "The access key ID to access the S3 bucket. Airbyte requires Read and Write permissions to the given bucket. Read more <a href=\\"https://docs.aws.amazon.com/general/latest/gr/aws-sec-cred-types.html#access-keys-and-secret-access-keys\\">here</a>.", "airbyte_secret": true}, "s3_bucket_name": {"type": "string", "order": 2, "title": "S3 Bucket Name", "examples": ["airbyte_sync"], "description": "The name of the S3 bucket. Read more <a href=\\"https://docs.aws.amazon.com/AmazonS3/latest/userguide/create-bucket-overview.html\\">here</a>."}, "s3_bucket_path": {"type": "string", "order": 3, "title": "S3 Bucket Path", "examples": ["data_sync/test"], "description": "Directory under the S3 bucket where data will be written. Read more <a href=\\"https://docs.airbyte.com/integrations/destinations/s3#:~:text=to%20format%20the-,bucket%20path,-%3A\\">here</a>"}, "s3_path_format": {"type": "string", "order": 7, "title": "S3 Path Format (Optional)", "examples": ["${NAMESPACE}/${STREAM_NAME}/${YEAR}_${MONTH}_${DAY}_${EPOCH}_"], "description": "Format string on how data will be organized inside the S3 bucket directory. Read more <a href=\\"https://docs.airbyte.com/integrations/destinations/s3#:~:text=The%20full%20path%20of%20the%20output%20data%20with%20the%20default%20S3%20path%20format\\">here</a>"}, "s3_bucket_region": {"enum": ["", "us-east-1", "us-east-2", "us-west-1", "us-west-2", "af-south-1", "ap-east-1", "ap-south-1", "ap-northeast-1", "ap-northeast-2", "ap-northeast-3", "ap-southeast-1", "ap-southeast-2", "ca-central-1", "cn-north-1", "cn-northwest-1", "eu-central-1", "eu-north-1", "eu-south-1", "eu-west-1", "eu-west-2", "eu-west-3", "sa-east-1", "me-south-1", "us-gov-east-1", "us-gov-west-1"], "type": "string", "order": 4, "title": "S3 Bucket Region", "default": "", "description": "The region of the S3 bucket. See <a href=\\"https://docs.aws.amazon.com/AWSEC2/latest/UserGuide/using-regions-availability-zones.html#concepts-available-regions\\">here</a> for all region codes."}, "secret_access_key": {"type": "string", "order": 1, "title": "S3 Access Key *", "examples": ["a012345678910ABCDEFGH/AbCdEfGhEXAMPLEKEY"], "description": "The corresponding secret to the access key ID. Read more <a href=\\"https://docs.aws.amazon.com/general/latest/gr/aws-sec-cred-types.html#access-keys-and-secret-access-keys\\">here</a>", "airbyte_secret": true}}, "additionalProperties": false}, "supported_destination_sync_modes": ["overwrite", "append"]}','generally_available',null,'