insert into ds_task.actor_definition(`id`,`name`,`docker_repository`,`docker_image_tag`,`documentation_url`,`icon`,`actor_type`,`source_type`,`spec`,`release_stage`,`release_date`,`resource_requirements`,`for_ds_template`,`is_open`,`description`,`delete_status`,`create_by`,`create_time`,`update_by`,`update_time`) values ('507','BigQuery','airbyte/destination-bigquery','1.1.8','https://docs.airbyte.io/integrations/destinations/bigquery','https://cbs-flink-sg.obs.ap-southeast-3.myhuaweicloud.com/icons/bigquery.svg','destination',null,'{"supportsDBT": true, "documentationUrl": "https://docs.airbyte.io/integrations/destinations/bigquery", "supportsIncremental": true, "supportsNormalization": true, "connectionSpecification": {"type": "object", "title": "BigQuery Destination Spec", "$schema": "http://json-schema.org/draft-07/schema#", "required": ["project_id", "dataset_location", "dataset_id"], "properties": {"dataset_id": {"type": "string", "order": 2, "title": "Default Dataset ID", "description": "The default BigQuery Dataset ID that tables are replicated to if the source does not specify a namespace. Read more <a href=\\"https://cloud.google.com/bigquery/docs/datasets#create-dataset\\">here</a>."}, "project_id": {"type": "string", "order": 0, "title": "Project ID", "description": "The GCP project ID for the project containing the target BigQuery dataset. Read more <a href=\\"https://cloud.google.com/resource-manager/docs/creating-managing-projects#identifying_projects\\">here</a>."}, "loading_method": {"type": "object", "oneOf": [{"title": "Standard Inserts", "required": ["method"], "properties": {"method": {"type": "string", "const": "Standard"}}, "additionalProperties": false}, {"title": "GCS Staging", "required": ["method", "gcs_bucket_name", "gcs_bucket_path", "credential"], "properties": {"method": {"type": "string", "const": "GCS Staging", "order": 0}, "credential": {"type": "object", "oneOf": [{"title": "HMAC key", "required": ["credential_type", "hmac_key_acce